		"text": "이번주 토요일! 정말 오랜만에 서울에서 관객과 만나는 드링킹소년소녀합창단입니다. 햇살 좋은 가을 노들섬에서 만나요👋👋👋\n\n[음악노들 온에어 (골든인디컬렉션) ]\n10월17일 18시 노들섬 라이브하우스\n\n드링킹소년소녀합창단\n텐거\n\n예매 : https://t.co/y1maEEIktB https://t.co/lvbJz1LFjn"
