		"full_text": "에이퍼즈는 멤버들 스스로 작편곡한 넘버들을 바탕으로, 매번 무대마다 어떻게 달라질지 모르는 즉흥 연주를 선보이는 '라이브파' 실력자들이기도 합니다. 무대와 객석의 경계가 허물어지는 파란만장에서 여러분의 흥을 에이퍼즈와 나누고, 단 한 번이 될 이들의 음악을 경험하시기 바랍니다",
