		"full_text": "보다 다양한 음악, 황홀한 연주를 감상하기 원하는 사람이라면 바로 지금 에이퍼즈(A-Fuzz)를 만나야 합니다. 에이퍼즈는 김진이, 송슬기, 신선미로 이루어진 밴드입니다. 2015년 첫 EP [Fading Lights]로 데뷔 , 그해 EBS 스페이스 공감 '올해의 헬로루키' 대상, K-루키즈 우수상을 수상하며",
