		"text": "[시공간집 3] 다섯째 날의 아름다운 풍경 👀 (숨은 김소연 시인 &amp; 이성미 시인 찾기)\n\n#재미공작소 #시공간집 #시공간집3 #강성은 #김소연 #김행숙 #박시하 #신해욱 #이성미 #이원 #이제니 #정한아 #하재연 \n#서울문화재단 #2020예술공간지원사업 https://t.co/sT2zaZqzlZ"
